    from swixknife import sezimal
    from swixknife import Sezimal as S, SezimalRange as SR, \
        sezimal_format, sezimal_context
    from decimal import Decimal as D

    sezimal_context.sezimal_precision = 1200

    def _formata_fracao(fracao, refina=False):
        fracao = str(fracao)

        try:
            if not refina:
                formato = sezimal_format(fracao, recurring_digits_notation='...')

        except:
            refina = True

        if refina:
            j = 0

            formato = fracao

            while j <= 6:
                fixo = '0.'
                fixo += '0' * j

                comeco = str(fracao).replace(fixo, '')[0:12]
                partes = str(fracao).split(comeco)

                if len(partes) >= 3:
                    f = '0.' + comeco + partes[1]
                    sezimal_places = D(len(comeco + partes[1]))
                    formato = sezimal_format(f, sezimal_places=sezimal_places)

                    formato = formato[2:]

                    if j == 0:
                        formato = fixo + '.' + formato + '...'
                    else:
                        formato = fixo + '..' + formato + '...'

                    break

                j += 1

        return formato

    for i in SR(D('541'), D('721')):
        fracao = S('1') / i

        formato = _formata_fracao(fracao)

        if formato == str(fracao):
            sezimal_context.sezimal_precision *= 100
            del sezimal._RECIPROCAL_MAP[str(i)]
            fracao = S('1') / i
            sezimal_context.sezimal_precision /= 100

            formato = _formata_fracao(fracao, refina=True)

            if formato == str(fracao):
                sezimal_context.sezimal_precision *= 1000
                del sezimal._RECIPROCAL_MAP[str(i)]
                fracao = S('1') / i
                sezimal_context.sezimal_precision /= 1000

                formato = _formata_fracao(fracao, refina=True)

        print(f"""'{i}': '{formato}',""")
